function drawHeatMap(value) {
	$("#heatOpts").hide();
    try {
        $("#popup-closer").click();
    } catch (ex) {}
    try {
        map.removeLayer(heatMap);
    } catch (ex) {}
    var table = "";
    switch ($("#selHeatMap").val()) {
        case 'farmer':
            table = "farmers";
            break;

        case 'stores':
            table = "stores";
            break;

        case 'vacancy':
            table = "vacancies";
            break;

        case 'population':
            table = "midwestpop";
            break;

        case 'income':
            table = "midwestinc";
            break;

        case 'density':
            table = "density";
            break;

        case 'gardens':
            table = "gardens";
            break;

        case 'culver':
            table = "culver";
            break;

        case 'reset':
            table = "reset";
            break;

        default:
            break;
    }

    if (table == "reset")
        map.removeLayer(heatMap);
    else {
		$("#heatOpts").show();
		map.removeLayer(heatMap);
        heatMap = new ol.layer.Heatmap({
            name: "Heatmap",
            source: new ol.source.Vector({
                url: 'getHMData.php?value=' + table,
                format: new ol.format.GeoJSON(),
                projection: 'EPSG:3857'
            }),
            gradient: ['#00f', '#662506', '#ffffe5', '#fec', '#993404'],
			radius: 4,
			shadow: 550,
			blur:  19,
			opacity: 0.8
        });

        map.getLayers().insertAt(134, heatMap);
    }
}

