	function linkArc(d, s) {
		flag++;
        var dx = d.target.x - d.source.x;
        var dy = d.target.y - d.source.y;
        var dr = Math.sqrt(dx * dx + dy * dy);
        var spath = s == false ? ' 0 0,0 ' : ' 0 0,1 ';
        return 'M' + d.source.x + ',' + d.source.y + 'A' + dr + ',' + dr + spath + d.target.x + ',' + d.target.y;
    }
